import React from "react";

const Invoices = () => (
  <section className="bg-white rounded shadow p-4">
    <h2 className="text-xl font-semibold mb-2">Invoices</h2>
    <button className="bg-blue-500 text-white px-3 py-1 rounded mb-2">Create Invoice</button>
    <ul>
      <li>Invoice #001 <span className="ml-2 text-xs bg-red-100 text-red-700 px-2 py-1 rounded">Unpaid</span></li>
      <li>Invoice #002 <span className="ml-2 text-xs bg-green-100 text-green-700 px-2 py-1 rounded">Paid</span></li>
    </ul>
  </section>
);

export default Invoices;
